import React, { Component } from "react";
import UtenteDataService from "C:/Users/ines_/fisiosys/frontend/src/services/tutorial.service.js"
import { Form } from 'protected-aidaforms';
import json from './InitialEvaluation.js';
import { Link } from "react-router-dom";
import CIcon from '@coreui/icons-react'
import {cilPencil, cilUserX} from '@coreui/icons'
import { useParams } from 'react-router-dom'; // import the useParams hook

export default class Utentes extends Component {
  constructor(props) {
    super(props);
    this.onChangeSearchnome_utente = this.onChangeSearchnome_utente.bind(this);
    this.retrieveUtente = this.retrieveUtente.bind(this);
    this.refreshList = this.refreshList.bind(this);
    this.setActiveUtente = this.setActiveUtente.bind(this);
    this.removeAllUtente = this.removeAllUtente.bind(this);
    this.searchnome_utente = this.searchnome_utente.bind(this);

    this.state = {
      Utente: [],
      currentUtente: null,
      currentIndex: -1,
      searchnome_utente: ""
    };
  }

  componentDidMount() {
    this.retrieveUtente();
  }

  onChangeSearchnum_sequencial(e) {
    const searchnum_sequencial = e.target.value;

    this.setState({
      searchnum_sequencial: searchnum_sequencial
    });
  }

  retrieveUtente() {
    UtenteDataService.getAll()
      .then(response => {
        this.setState({
          Utente: response.data
        });
        console.log(response.data);
      })
      .catch(e => {
        console.log(e);
      });
  }

  refreshList() {
    this.retrieveUtente();
    this.setState({
      currentUtente: null,
      currentIndex: -1
    });
  }

  setActiveUtente(Utente, index) {
    this.setState({
      currentUtente: Utente,
      currentIndex: index
    });
  }

  removeAllUtente() {
    UtenteDataService.deleteAll()
      .then(response => {
        console.log(response.data);
        this.refreshList();
      })
      .catch(e => {
        console.log(e);
      });
  }

  searchnum_sequencial() {
    this.setState({
      currentUtente: null,
      currentIndex: -1
    });

    UtenteDataService.findBynum_sequencial(this.state.searchnum_sequencial)
      .then(response => {
        this.setState({
          Utente: response.data
        });
        console.log(response.data);
      })
      .catch(e => {
        console.log(e);
      });
  }

  render() {
    const { currentUtente } = this.state;

    return (
      <Form
      onSubmit={(values, changedFields) => console.log("SUBMITTED VALUES: ", values, "CHANGED FIELDS: ", changedFields)}
      onSave={(values, changedFields) => console.log("SAVED VALUES: ", values, "CHANGED FIELDS: ", changedFields)}
      onCancel={status => console.log("CANCELLED:", status)}
      template={json}
      dlm={{}}
      showPrint={true}
      editMode={true}
      professionalTasks={["Registar Pedido", "Consultar Pedido", "Anular Pedido"]}
      canSubmit={true}
      canSave={true}
      canCancel={true}
      patientData={{
        "numSequencial": currentUtente.num_sequencial,
        "episodio": 21016848,
        "modulo": "INT",
        "processo": 99998888,
        "nome": currentUtente.nome_utente,
        "dtaNascimento": currentUtente.data_nascimento,
        "idade": 77,
        "sexo": "Masculino"
      }}
      reportData={{
        dtaEncerrada: "22-05-2019 13:02",
        dtaCriada: "10-05-2019 18:47",
        realizada: "Joana Pascoal",
        responsavel: "José Costa"
      }}
      referenceModel={[
        {
          "itemName": "Número mecanográfico",
          "item": "num_mecanografico",
          "value": "123456",
          "formVisible": true
        },
        {
          "itemName": "Número sequencial",
          "item": "num_seq",
          "value": currentUtente.num_sequencial,
          "formVisible": true
        },
        {
          "itemName": "Nome",
          "item": "Nome",
          "value": currentUtente.nome_utente,
          "formVisible": true
        }
      ]}
      submitButtonDisabled={false}
      saveButtonDisabled={false}
    />
    );
  }
}
